import { Link } from "react-router-dom";

const Navbar = ({ toggle, setToggle }) => {
  return (
    <nav className={`navbar ${toggle ? 'navbar-open' : ''}`}>
      <ul className="nav-links">
        <Link onClick={() => setToggle(false)} to="/" className="nav-link">
          <i className="bi bi-house"></i>
          Home
        </Link>
        <Link onClick={() => setToggle(false)} to="/posts" className="nav-link">
          <i className="bi bi-stickies"></i>
          Posts
        </Link>
        <Link onClick={() => setToggle(false)} to="/posts/create" className="nav-link">
          <i className="bi bi-journal-plus"></i>
          Create
        </Link>
        <Link onClick={() => setToggle(false)} to="/admin-dashboard" className="nav-link">
          <i className="bi bi-person-check"></i>
          Admin Dashboard
        </Link>
      </ul>
    </nav>
  );
};

export default Navbar;
